import React, { Component } from 'react';
import TimelineEvent from './TimelineEvent';

class TimelineYear extends Component {

  componentDidMount() {
    console.log(this.props)
  }

  render() {
    return (
        <div className="year">
          {this.props.year}
          {this.props.events.map(function(event) {
              <div>{event}</div>
            })}
        </div>
    )
  }
}

export default TimelineYear;
